INSERT INTO `aboutus` (`id`, `caption`, `description`, `image`, `alt`, `created_at`, `updated_at`, `status`) VALUES
(1, 'About Us', '<p>Aegis Logistics and International Movers – ALIM is a venture of experienced professionals with dedicated and well trained crew in the supply chain industry. We provide flexible end-to-end solutions that assist companies and individuals to meet their objectives by giving the best possible service at competitive prices. We are using own branded high quality packing materials and other supporting services to ensure the move stress free and affordable price.</p><h3>Mission:</h3><p>Our mission is to provide the best customer service and connect the people with their world, everywhere they live and work, and try do it better than anyone else.</p><h3>We are equipped with following features:</h3><ul><li>Stress Free Shipping Services</li><li>Dedicated and well trained crew</li><li>Flexible end-to-end solutions</li><li>Overnight Freight Service</li><li>High Quality Packing Materials</li><li>International Logistics Solution</li><li>Export and Import handling</li><li>Shipping Containers Around the Globe</li><li>All kinds of Trucks for Land Transport</li><li>On-time Delivery</li></ul>', 'about-banner.webp', 'Aegis Logistics', '2023-10-11 06:05:10', '2025-01-16 08:40:18', 0);
