(5, 'Babar Naseer', 'info@rsi.com.pk', '03332249770', 'Greetings from R.S. International Manpower Agency. \r\nWe R.S. International (Lic: 2292/KAR) are an Manpower / recruitment services registered company based in Pakistan. We can supply Skilled and Unskilled Manpower with a consultative approach.\r\nIf you need one window solution to all your Manpower / recruitment needs, please give us a chance to prove our mettle by providing competent, qualified and experienced candidates to you in a very professional and timely manner. We have Interview and Trade Testing Facilities in major cities in Pakistan. We are looking forward to work with your esteemed organization.\r\n\r\nRegards,\r\nR.S International\r\nMob: +92 333 2249770 (WhatsApp)\r\nEmail: babar@rsi.com.pk\r\nWeb: www.rsi.com.pk\r\n', '2023-11-08 07:41:59', 0),
(6, 'Arslan Shah ', 'hr1@ghazioverseas.com', '+923190978260', 'Dear Sir / Madam\r\n \r\nGreetings from Ghazi Overseas Employment\r\n \r\nI’m pleased to offer you our HR & Recruitment services for your company’s upcoming hiring projects from Pakistan.\r\n \r\nMoreover, I would like to introduce Ghazi Overseas Employment LIC # MPD/2636/KAR as one of the leading HR/Recruitment companies in Pakistan, having offices in Karachi, Lahore Islamabad, and has been successfully serving its clients all across the middle east – Kingdom of Saudi Arabia, Sultanate of Oman, State of Qatar, United Arab Emirates & Kingdom of Bahrain. We have our huge database of candidates as well as have a well-equipped Trade Test Facility so that clients can check the skills of the worker as required for maximum satisfaction.\r\n \r\nSteps we take to make Recruitment Campaign successful :\r\n \r\n•	Soon after finalizing the agreement between the company and our manpower consultancy & receiving the necessary document (Power of Attorney and Demand Letter – Original ) along with E-Wakala,\r\n•	We proceed with publishing an advertisement (if required ) to get more quantity and quality of candidates for pre-screening,\r\n•	As well as shortlist candidates from our database to have more options for selection,\r\n•	We also offer our clients different locations in Pakistan ( Karachi – Lahore – Islamabad – Multan  - Peshawar) to have a variety of candidates according to their needs,\r\n•	Along which we have Trade Test facility from which we satisfy our client that candidate has to hand on required experience,\r\n•	Other than this we can arrange Skype & Telephonic Interviews as per our clients’ comfort. \r\n \r\nTime Frame after selection:\r\n \r\n   \r\nS#	Process	Days\r\n1	Degree Attestation from Saudi Culture   (if required)	40-45 days\r\n2	Degree Attestation from Saudi Embassy   (if required)	1-2 days\r\n3	Medical & biometric verification of candidate	2-3 days\r\n4	VISA Stamping from Saudi Embassy	2-3 days