(13, 'Dimitrios parisis', 'poukoutzis@yahoo.gr', '00306936781311', 'Hello,\r\nI work for a signage company in Athens, Greece.\r\nWe are interested in a serious cooperation with a Saudi Arabian company located in Riyadh.\r\nI would like therefore to know If you have a partner or If you cooperate with a transport company in Greece.., in order to establish a stable and regular transport of shipments from Greece to Riyadh, Saudi Arabia.\r\nThank you in advance.', '2024-05-15 06:50:15', 0),
(14, 'Ghanendra Uprety', 'upretyg@gmail.com', '9851126457', 'Nepali workers supply; Nepal government  licensed recruitment agency.\r\n\r\n\r\nGood Morning,\r\n          \r\n1. We can provide laborers, cleaners, helpers, loading unloading, kitchen workers, sales, masons, carpenters, steel fixers, scaffolders, heavy drivers, equipment operators, electricians, welders, housekeeping, sales, waiters, cooks, baristas, beauticians, supervisors, foreman, safety officers and other categories. \r\n\r\n\r\n2. One month’s salary as a service charge. Candidates can be charged for this.\r\n\r\n\r\n3. Joining ticket as per the company’s policy.\r\n\r\n\r\n4. Nepal Embassy/Consulate attested demand papers are mandatory to start the recruitment process. \r\n\r\n\r\nThanks and Regards,\r\nGhanendra Uprety (linkedin)\r\nManaging Director\r\nElite HR Solution Pvt. Ltd.\r\nLicense no: 1361/074/075\r\n09779851126457 (Mob/Whats app)\r\n', '2024-06-13 10:35:04', 0),
