(16, 'Julia Lisk', 'lisk.julia97@gmail.com', '0532370976', 'Dear team,\r\nI am planning to relocate on Saturday (29th June). Everything is packed into boxes already, just needs to be transported out of the old house and into the new house. There are 7 big carton boxes, 3 suitcases (1 big, 2 small), 1 small carton box, 4 narrow boxes (contain small table and shelf). \r\nThe new place is 11km from my okd home. \r\nOld home: Al Qirawan -> New home: Al Malqa\r\nIs it possible to send me an offer about how much it would cost? \r\n\r\nThank you in advance!\r\nBest wishes,\r\nJulia Lisk', '2024-06-23 14:06:19', 0),
