(36, 'ASSAD KHAN', 'assadkhan3230@gmail.com', '0596742893', 'Hello,\r\n\r\nThis is Assad Khan, I have total 15 years of experience in Transport and Logistic in KSA and 5 years in India, I have worked in Almarai, for 2.5 years handling 350 trucks, worked for Aramco Cargo for 2 years and worked with Bakhashab Transport for 8.3 years as Project Coordinator cum Branch Supervisor for Saudi Chemical Project Riyadh.\r\n\r\nCurrently I am working in a Waste Management Company for 3 months and I am looking for a change, In case you find my CV matches your requirement please let me know.\r\n\r\nPlease find the attached latest CV for your reference. Also let me know if you need any supporting documents.\r\n\r\n\r\nRegards,\r\n\r\nAssad Khan.\r\n0596742893', '2024-09-22 07:12:46', 0),
(37, 'HR DEPARTMENT SAMEER QURESHI', 'appleconsultancyhr@gmail.com', '9833083776', 'Manpower Recruiting Agencies\r\n\r\nApple Travels & Consultancy is a premier talent solutions company that brings dependable manpower to professional multinationals in Middle-east. With over 40 years of experience in delivering project-based personnel, we deliver across Project Management, Supervisory, Skilled and Unskilled categories. Our agency caters to EPC mega-projects in Oil and Gas Off shore services, Power, Energy and Heavy Engineering and Civil Construction, MEP (Electromechanical companies), Ship repair companies, Facilities management, Constructions, Interior Decoration, O&M projects, refineries, power plants, petrochemicals, fertilizers, chemicals, manufacturing, steel structural industries, airports, seaports, factories hospitality industries (hotel/catering), hospitals (Medical & Para-Medical), and software professionals helping clients create win-win situations. Our keen insight and acumen helps nurture personnel with the right aptitude and attitude. We maintain a comprehensive databank of personnel based on research and client demands.\r\nApple Travels & Consultancy caters particularly to the Arabian Gulf regions and our clientele are spread all over the Kingdom of Saudi Arabia , United Arab Emirates Kuwait, Doha-Qatar , Oman, Bahrain, Yemen, Jordan, and Afghanistan , including continents of Africa and some offshore projects in European countries.\r\nApple Consultancy has established itself as a quality conscious firm, sourcing the right candidates for the right job.\r\nPresently our esteemed clients in Sultanate of Oman are 29 reputed and leading companies with other esteemed clients in Bahrain, Qatar and Saudi Arabia. At present we are recruiting 50 candidates to M/s Rouge Pipe line services, UAE (for their pipeline project in Saudi Arabia, Kuwait, Turkmenistan and Oman), 2100 Construction personnel for M/s Service & Trade Group, M/s GICI Qatar, and still continuing, We are also in the process of finilizing recruitment of Heavy fabrication personnle for M/s STS - Oman and Ras Al Khaima, M/s Mustafa Kamal Ashraf Group Civil and Mechanical Division, M/s Al Yafie International (London cleaning and Maintenance), M/s Clarion International Oman, M/s AlFakhama Group of Companies, M/s Tawoos Agriculture, M/s JMG Construction, M/s Arabsealine, M/s Khaleej Manager Cont. Co., M/s Dewnid Trading and Cont. M/s Inco Group of Companies Oman etc for the current year 2018-19. We had recruited 1800 candidates for M/s Chapoz (Bahrain, Qatar and Saudi Arabia) and recruiting around 175 candidates to M/s Inco group of companies (Turkish company) for their projects in U.A.E, Qatar. Magnum ship care services etc. We had recruited good number of candidates forM/S Orascom – CI - Afghanistan in the year 2006. We had also recruited Welders and Fabricators for M/s Larsen and Toubro - AlTurki Saudi Arabia.\r\nWe have branches and a full equipped training centre with professionals in all disciplines in different parts of the country, and also associate offices in Nepal, Sri-Lanka and Bangladesh, which enables our clients to select the right staff as per the job specifications / profiles provided.\r\nWe maintain an ever-increasing database with details of a large number of available personnel for our ready references through head hunting and advertisement.\r\nIt will always be a great pleasure for us to serve an esteemed organization of your fame and we look forward to a positive response from your end for your future manpower needs.\r\nThanking you and assuring of our best services, co-operation and attention at all times.\r\nVery truly yours,\r\nFOR APPLE CONSULTANCY\r\nSAMEER QURESHI\r\nHR DEPARTMENT\r\nDCB, BANK BLDG, 3RD FLOOR ROOM NO. 67 & 68\r\nNEAR GULSHAN I - RAN HOTEL, CRAWFORD MARKET\r\nPALTON ROAD,\r\nMUMBAI : 400001 -\r\nMAHARASHTRA\r\nINDIA\r\nTEL :009122-49706642 / 49706641\r\nFax : 009122-49706643\r\nGSM: 0091-9833083776\r\nWatshapp Number : 0091- 9833083776\r\nEMAIL : appleconsultancyhr@gmail.com\r\nwww.appleconsultancy.com\r\nWe have our overseas branch office in UAE\r\nAwaiting For Your Quick Respone\r\n\r\n', '2024-10-09 10:04:37', 0),
