(41, 'Ghanendra Uprety', 'upretyg@gmail.com', '09779851126457', 'Logistics workers recruitment from Nepal. Recruitment fee and air ticket expense from the candidates.\r\n\r\nDear Admin/Recruitment Officer, \r\nAegis Logistics & International Movers (ALIM), KSA.\r\n\r\nI represent a manpower agency from Nepal. Elite HR Solution Pvt. Ltd (Govt Lic no; 1361/074/075).\r\n\r\n1. We provide load unload labors, warehouse workers, storekeepers, forklift drivers, pick up van drivers, heavy truck/trailer drivers, office helpers etc. from Nepal.\r\n \r\n2. Nepali Embassy in Riyadh/Consulate in Jeddah attested demand papers are required for the recruitment process. We prepare a demand draft and assist the company for online attestation. \r\n\r\n3. The Company should not pay a recruitment fee to our agency. Candidates will pay. \r\n\r\n4. Candidates will do their joining air ticket.  \r\n\r\nYours sincerely,\r\nGhanendra Uprety\r\nOwner/Managing Director\r\n09779851126457 (Mob/Whatsapp)', '2024-11-10 11:27:08', 0),
