(274, 'Ahmed Chand', 'ahmedchand186@gmail.com', '570120985', 'Dear SirMadamI hope this message finds you wellMy name is Ahmed Chand and I am a Sales Executive at SoundBox based in Guangzhou City ChinaWe specialize in Silence Booths of various sizes and are seeking a detailed quotation for your storage logistics and installation servicesWe would appreciate it if you could provide the quotation at your earliest convenienceThank you for your time and considerationBest regardsAhmed ChandSales Executive  SoundBox', '2025-11-17 08:06:56', 0);
INSERT INTO `faq` (`id`, `service_id`, `caption`, `description`, `status`) VALUES
(1, 1, 'How much does a moving company Riyadh cost for moving services?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">The cost of moving and relocating can vary; it depends on the type of move, volume of belongings, and distance. Aegis Logistics and International Movers are provides reasonable prices for all your moving and relocation needs.</span></p>', 0),
(2, 1, 'How do I choose reliable movers in Riyadh, Saudi Arabia?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Research and compare reviews of different relocation companies. And also ensure that the company is licensed and has a good track record.</span></p>', 0),
(3, 1, 'Difference between a moving and relocation company?', '<p>Moving companies handle transportation, while relocation services provide comprehensive support, including visa assistance, housing, and cultural integration.</p>\r\n', 0),
(4, 1, 'How long does the relocation process take?', '<p>It depends on the destination, the services required, and the volume of belongings. A reputable company can provide a timeline based on your specific situation.</p>\r\n', 0),
(5, 1, 'Do movers and packers in Riyad provide insurance for belongings during the move?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, many reputable movers and packers in Riyad offer insurance for your belongings. Aegis provides insurance options to cover the loss or damage to belongings during the move.</span></p>', 0),
(6, 2, 'Is warehousing part of logistics?', '<p>Sure, it has a vital role in logistics. Warehousing facilitates the whole order fulfillment process services from the point of origin to the point of consumption. It offers you the ability to store, ship, and distribute your belongings from one location to another.</p>\r\n', 0),
(7, 2, 'How much does a warehouse cost in Saudi Arabia?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">It may vary; it mainly depends on facilities, size, location, etc. But at Aegis, we offer reasonable costs for warehousing.&nbsp;</span></p>', 0),
(8, 2, 'Why do we need warehouses?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Goods warehousing and storage are essential to logistics because they provide security, safety, and ease of logistics organization.</span></p>', 0),
(9, 2, 'What kind of items could be stored in the warehouse?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Warehouse logistics can efficiently store a diverse range of items, from raw materials and finished goods to electronics and perishables. Our facilities accommodate various industries, ensuring optimal storage solutions.</span></p>', 0),
(10, 2, 'What is involved in warehouse management? ', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">It includes inbound processing, warehouse layout and slotting, picking, packing, shipping, and managing returns.</span></p>', 0),
(11, 3, 'What logistics services are available in Riyadh? ', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Riyadh offers a range of logistics services, including transportation, warehousing, freight forwarding, customs clearance, and last-mile delivery.</span></p>', 0),
(12, 3, 'What are inbound and outbound logistics?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Both are the common processes for moving goods. Inbound logistics brings supplies or materials into a business for production and outbound logistics means it deals with moving goods and products out to customers.&nbsp;</span></p>', 0),
(13, 3, 'What is the price of a logistics service?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">The cost of logistics services depends on factors like distance, cargo type, mode of transport, and size and quantity of the goods.&nbsp;</span></p>', 0),
(14, 3, 'How much time does customs clearance take in Saudi Arabia?', '<p style=\"margin-left:36pt;\"><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">The customs clearance usually takes one or two days if the goods are shipped in compliance with all customs regulatory requirements. The AEGIS team are experts in customs procedures, ensuring a smooth and speedy clearance process.</span></p>', 0),
(15, 3, 'What are the different types of packing materials used by Aegis?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Based on each customer, item to move, and requirements, we use: cartons – small, medium large &amp; book, foam and corrugated roll, paper, flat and hanging wardrobes, flat boards, non-acidic paper, silica gel and super dry sticks, wood, bags, glass containers, and blankets.</span></p>', 0),
(16, 4, 'What documents are required for customs clearance?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Common documents include a detailed inventory list, passport copies, visa documentation, residence permit, and a letter of employment. Additional documents may be needed based on specific regulations.</span></p>', 0),
(17, 4, 'Are there any products that cannot be imported into Riyadh for the purpose of relocation?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, certain items may be restricted or prohibited.&nbsp;</span></p>', 2),
(18, 4, 'How long does customs', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">The duration varies based on the completeness</span></p>', 2),
(19, 5, 'What factors should I consider when choosing a moving company in Riyadh?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">When choosing a moving company in Riyadh, you should consider their Experience, Reputation, Services Offered, Insurance, and Price. Aegis is an experienced and leading office and industrial moving company in Riyadh, Saudi Arabia, which offers reasonable prices and insurance for your move.</span></p>', 0),
(20, 5, 'How can I minimize downtime during my office move?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">There are a number of things you can do to minimize downtime during your office move they are: plan and communicate early, pack efficiently, move on a weekend or after hours, and hire professional movers.&nbsp;</span></p>', 0),
(21, 5, 'What special considerations are there for moving IT equipment?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">IT equipment is delicate and expensive, so it is important to take special care when moving it. Firstly, backup all data, disconnect and pack carefully, and label clearly.&nbsp;</span></p>', 0),
(22, 5, 'Do you have special equipment for moving heavy machinery?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, we have all the tools and equipment to move heavy machinery. We also use the latest technology to ensure smooth moving.&nbsp;</span></p>', 0),
(23, 5, 'How do I prepare my office for moving?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Start early, declutter &amp; label, pack non-essentials, plan IT relocation, and minimize downtime with weekend moves &amp; pro movers.</span></p>', 0),
(24, 6, 'Why is furniture fixtures and equipments (FF&E) moving important?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">It is essential during relocations, renovations, or when businesses are changing locations. It ensures that the furniture, electronics, and other equipment are transported safely and efficiently, minimizing downtime for businesses.</span></p>', 0),
(25, 6, 'What types of businesses usually use FF&E moving services?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Businesses across various industries may require FF&amp;E moving services, including offices, hotels, restaurants, healthcare facilities, educational institutions, and more. If you want to move furniture, fixtures, and equipment, contact us for stress free moving experience.&nbsp;</span></p>', 0),
(26, 6, 'How can businesses minimize disruptions during furniture fixtures and equipments moving?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">To minimize disruptions, businesses can schedule the FF&amp;E move during periods of low activity, such as weekends or evenings.&nbsp;</span></p>', 0),
(27, 6, 'How can businesses ensure the safety of their assets during FF&E moving?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Businesses can ensure the safety of their assets by properly packing and securing items before transportation. Labeling fragile items, using appropriate packing materials, and hiring experienced and reputable moving companies like Aegis can contribute to a smooth and safe moving process.</span></p>', 0),
(28, 6, 'How much do furniture fixtures and equipments moving cost?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">The cost will vary depending on a number of factors, such as the size and weight of your items, the distance you are moving, and the services you need.</span></p>', 0),
(29, 4, 'Are there any products that cannot be imported into Riyadh for the purpose of relocation?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, certain items may be restricted or prohibited. Its essential to check with local authorities for the latest regulations on items like electronics, furniture, and personal belongings.</span></p>', 2),
(30, 7, 'Is documentation required for sea freight?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Required documents typically include a commercial invoice, packing list, bill of lading, certificate of origin, and any specific documentation required by the destination country.</span></p>', 0),
(31, 7, 'What is the difference between FCL (Full Container Load) and LCL (Less than Container Load)?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">FCL dedicates a container to one shipper; LCL shares containers. FCL suits large loads, while LCL is more cost-effective for smaller shipments.&nbsp;</span></p>', 0),
(32, 7, 'Can I track my sea freight shipment from Riyadh?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, many shipping companies provide online tracking services. Aegis provides sea freight shipment tracking so you can monitor the status and location of your shipment in real-time.</span></p>', 0),
(33, 7, 'What is the role of customs clearance in sea freight?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Customs clearance is a crucial step in sea freight. It involves the submission and approval of required documents, payment of duties and taxes, and compliance with import/export regulations of the destination country.</span></p>', 0),
(34, 7, 'Do we need to get insurance?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Many companies offer insurance coverage options to protect against loss or damage. Aegis offers the best insurance options for your shipment; contact us for more information.</span></p>', 0),
(35, 8, 'What are the benefits of using air freight?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Air freight offers speed, ideal for time-sensitive shipments, efficient global connectivity, reliable schedules, and quick delivery, reducing overall transit time.</span></p>', 0),
(36, 8, 'What are the documents required for air freight in Riyadh?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Common documents include the air waybill, commercial invoice, packing list, certificate of origin, and any necessary permits or licenses. Compliance with customs regulations is crucial for smooth air freight processes.</span></p>', 0),
(37, 8, 'Do you ship furniture?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, we offer air freight for furniture, ensuring swift delivery with reliable service for a secure and efficient shipping experience.</span></p>', 0),
(38, 8, 'Is customs clearance required for air freight in Riyadh?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, customs clearance is necessary for air freight shipments. Contact us for more information.</span></p>', 0),
(39, 9, 'Are there any restrictions or guidelines for luggage and belongings?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Understand the company\'s policies regarding luggage size, weight restrictions, and any additional charges for excess baggage.</span></p>', 0),
(40, 9, 'How can I request a quote for my move at Aegis?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">You can typically request a quote through our company\'s website, by phone, or by visiting our office. Provide details about your move for an accurate estimate.&nbsp;</span></p>', 0),
(41, 10, 'Can I move my dog to Saudi Arabia?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, you can move your dog to Saudi Arabia with the help of any pet relocation service center like Aegis. Ensure microchipping, vaccinations, a health certificate, and compliance with local regulations.&nbsp;</span></p>', 0),
(42, 10, 'Do you need a veterinary certificate for pet relocation in Saudi Arabia?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, a veterinary health certificate is an important requirement for pet relocation to Saudi Arabia.</span></p>', 0),
(43, 10, 'Are there any microchipping requirements for pets in Riyadh?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Microchipping may be a requirement for pet entry into Riyadh. Ensure that your pet has a microchip with updated information before travel.</span></p>', 0),
(44, 10, 'Importance of hiring a pet relocation service?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">They can handle the entire process, including paperwork, transportation, and even assisting with the settling-in process in Riyadh. Contact us for more information about pet relocation.</span></p>', 0),
(45, 4, 'Are there any products that cannot be imported into Riyadh for the purpose of relocation?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, certain items may be restricted or prohibited. Its essential to check with local authorities for the latest regulations on items like electronics, furniture, and personal belongings.</span></p>', 2),
(46, 4, 'Are there any products that cannot be imported into Riyadh for the purpose of relocation?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, certain items may be restricted or prohibited. It\'s essential to check with local authorities for the latest regulations on items like electronics, furniture, and personal belongings.</span></p>', 0),
(47, 4, 'How long does customs clearance typically take in Riyadh for a relocation shipment?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">The duration varies based on the completeness of documentation, the type of goods, and customs processing times. It\'s advisable to start the clearance process well in advance. But we offer swift and efficient clearance of your goods through customs.</span></p>', 0),
(48, 4, 'When is Import Customs Clearance Needed?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Import customs clearance is needed when goods are brought into a country and their value exceeds a set limit, they are restricted, or duties apply.</span></p>', 0),
(49, 4, 'What are the advantages of using customs clearance?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Most important advantages are time and money savings. They can speed up the process of getting your goods through customs and into the country.</span></p>', 0),
(50, 8, 'What is the maximum size and weight limit for air freight shipments?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">The size and weight limits for air freight shipments depend on the airline and aircraft type. It\'s essential to check with the airline and adhere to their specific requirements.&nbsp;</span></p>', 0),
(51, 9, 'Is the company licensed and insured for moving services in Riyadh?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Ensure that the company is properly licensed and insured to handle your belongings during the moving process.</span></p>', 0),
(52, 9, 'Does the company provide packing and unpacking services?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Many moving companies offer packing and unpacking services as part of their packages. Confirm the details and any associated costs.</span></p>', 0),
(53, 9, 'Are there any storage options available if needed?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">Yes, Aegis provides storage facilities if there\'s a delay between moving out and moving into your new location.</span></p>', 0),
(54, 11, 'What are the steps involved in an international relocation?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">When you contact the provider of international relocation services, we plan the relocation by collecting all the information. Our team will pack your belongings and handle international shipping logistics. They\'ll navigate customs regulations to ensure the smooth import of your belongings.</span></p>', 0),
(55, 11, 'What locations does AEGIS provide international moving services at?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">AEGIS provides international relocation services to all locations, including international moving from Saudi Arabia to Dubai, Canada, America, UK, Europe, and France. We have branches in Riyadh, Dammam, and Jeddah and can assist with moving services worldwide.&nbsp;</span></p>', 0),
(56, 11, 'Does AEGIS move heavy goods?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">AEGIS moves all types of goods locally and internationally.&nbsp;</span></p>', 0),
(57, 11, 'Is moving insurance necessary for international relocation?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">All reputable moving companies provide insurance for all types of moving. AEGIS takes all the safety measures to protect your belongings from damage and also provides moving insurance for all moving services.&nbsp;</span></p>', 0),
(58, 12, 'Do you offer delivery and pickup services?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">Yes, we provide delivery and pickup services for all our heavy equipment.&nbsp;</span></p>', 0),
(59, 12, 'What is the equipment rental period?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">Our heavy equipment rental period normally runs from daily to monthly.&nbsp;</span></p>', 0),
(60, 12, 'What kind of fees are applied to the equipment rental services?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">Rental fees are normally based on the type of equipment, rental duration, usage, and the company that provides equipment rental services.</span><br>&nbsp;</p>', 0),
(61, 12, 'What types of heavy equipment do you rent?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">We offer a wide range of heavy equipment, including excavators, bulldozers, cranes, forklifts, and more. Please see our complete list on our website.</span></p>', 0),
(62, 12, 'Do you provide operators for heavy equipment rental in Saudi Arabia?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">Yes, we can provide skilled operators to handle the equipment safely and efficiently.</span></p>', 0),
(63, 3, 'Which is the best logistics company in Riyadh?', '<p style=\"margin-left:36pt;\"><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:11pt;\">AEGIS Logistics and International Movers is one of the best logistics companies in Riyadh, Saudi Arabia.&nbsp;</span></p>', 0),
(64, 11, 'Which is the best international moving company in Saudi Arabia?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">AEGIS Logistics and International Movers is one of the best International moving companies in Saudi Arabia.&nbsp;</span></p>', 0),
(65, 11, 'What sets AEGIS apart from others?', '<p><span style=\"background-color:transparent;color:#000000;font-family:Arial,sans-serif;font-size:12pt;\">AEGIS\' dedicated team provides exceptional customer services rather than high-quality services. We have English speaking staff who maintain regular communication during the move and ensure fast and reliable international relocation services worldwide.&nbsp;</span></p>', 0);
