(1, 1, 'Mohammad Ansari', 'Saudi Arabia to India', '<p>On Behalf of Mubashira, would love to take an opportunity to thank Aegis Logistics &amp; Int&#39;l movers for variety professional services of pickup,loading, coordinate and email exchange.</p>\r\n', '2023-10-07 00:19:07', '2025-03-10 17:01:42', 0),
(2, 1, 'Kristine Kerr', 'Oakland, New Zealand', '<p>A somewhat belated thank you very much for your excellent service. I was both pleased and impressed with your company&rsquo;s efficiency, attention to detail and prompt responses</p>\r\n', '2023-10-07 00:21:01', '2025-03-10 17:01:42', 0),
(3, 1, 'Ms.Farah Zafar', '', '<p>I wanted to thank you and your team for doing a great job. We both received our goods in Dubai and were very happy with the service.</p>\r\n', '2023-10-07 00:21:40', '2025-03-10 17:01:42', 0),
