(7, 1, 'Mr. Norman J Leite', 'Saudi Arabia to Bahrain', '<p>No issue at all and thank you Riyas, and also thank you for your prompt and efficient service.</p>\r\n', '2023-10-07 00:23:51', '2025-03-10 17:01:42', 0),
