(9, 1, 'Mr. Amir Imam', 'Riyadh to Dubai', '<p>I&#39;d like to extend our appreciation and thanks for a very professional team. The whole family is very satisfied with the service.</p>\r\n', '2023-10-07 00:24:54', '2025-03-10 17:01:42', 0),
(10, 1, 'Kinda Helmi', 'UAE to KSA', '<p>Team Saudi Arabia was very professional and accomodating . Thanks you very much.</p>\r\n', '2023-10-07 00:25:23', '2025-03-10 17:01:42', 0),
