(18, 1, 'Dr. Umar Farouqi', 'Riyad to Bahrain', '<p>Had to shift from saudi to Kingdom of Bahrain<br />\r\nFound Aegis Logistics as most professional and consumer friendly company.<br />\r\nHighly recommended for m@p services.<br />\r\nMr Nizam from saudi and Mr Jose from bahrain were particularly helpful.</p>\r\n', '2023-10-26 05:13:03', '2025-03-10 17:01:42', 0),
