(63, 3, 'Mr. Maysan AlShaar', 'Riyadh to Usa', '<p>Very professional, hard working, available for questions or concerns<br />\r\nFurniture received in the best way<br />\r\nI highly recommend this company<br />\r\nA very successful experience and their prices are reasonable</p>\r\n', '2023-10-25 23:34:55', '2023-10-25 23:34:55', 0),
(64, 3, 'Ms. María Calvente Aldea ', 'Riyadh to Spain', '<p>Very professional team, all my items are perfect. Nothing lost. The team in saudi and the team in Spain very helpful and professional. I highly recommend this company. Good price comparing with others companies.</p>\r\n', '2023-10-25 23:41:50', '2023-10-25 23:41:50', 0),
(65, 3, 'Mr. Sanjay Thakur', 'Jeddah to Riyadh', '<p>Amazing, professional and very Helpful staff.<br />\r\nHad one of the best and hassle free experience.</p>\r\n', '2023-10-25 23:42:29', '2023-10-25 23:42:29', 0),
(66, 3, 'Dr. Umar Farouqi', 'Riyad to Bahrain', '<p>Had to shift from saudi to Kingdom of Bahrain<br />\r\nFound Aegis Logistics as most professional and consumer friendly company.<br />\r\nHighly recommended for m@p services.<br />\r\nMr Nizam from saudi and Mr Jose from bahrain were particularly helpful.</p>\r\n', '2023-10-25 23:43:03', '2023-10-25 23:43:03', 0),
(67, 3, 'Jacqueline Newton', 'Dammam to UK', '<p>The logistics company were great very professional very quick, and the quote was much less than other companies. The shipment arrived safe and quickly. The staff are excellent I would recommend using</p>\r\n', '2023-10-25 23:43:36', '2023-10-25 23:43:36', 0),
(68, 3, 'Eric Niborg', 'Riyadh to Usa', '<p>I had a great experience with this company. Account manager extremely customer service oriented and professional. Straight quotation all inclusive with no gimmicks. Exactly on time service and very accommodating of my schedule, working the weekend and evening. The crew very experienced, careful, professional and courteous. Al my goods arrived 100% undamaged. Highly recommend!</p>\r\n', '2023-10-25 23:44:40', '2023-10-25 23:44:40', 0),
(69, 3, 'Mr. Bilal Ahmed', 'Riyadh to UK', '<p>I used them for relocating from Riyadh to London.<br />\r\nThey have a very professional team.<br />\r\nI would really appreciate Mr. Nisam who have been supportive throughout the whole process.</p>\r\n', '2023-10-25 23:45:19', '2023-10-25 23:45:19', 0),
(70, 3, 'Benjamin Wessendorf', 'Riyadh, KSA', '<p>Excellent Service. Highly recommended. Well trained, polite and professional team and Management. 5 star rating well deserved!!!</p>\r\n', '2023-10-25 23:46:05', '2023-10-25 23:46:05', 0),
(71, 3, 'Matias Vaira, PhD | Director of Economics', 'PIF -  Real Estate Assets Management', '<p>My family of four moved from Riyadh KSA to regional NSW, Sydney Australia.&nbsp;I would highly recommend this service for their professional and efficiency.&nbsp;<br>The team in Riyadh packed our things with care and courtesy and they were polite.&nbsp;The team from Sydney also made relocation easier with efficiency and good manners. They showed initiative and care with unloading and unpacking.&nbsp;</p>', '2024-03-17 20:11:45', '2024-03-17 20:12:56', 0),
(72, 3, 'The Meyer family', '', '<p>Dear Team, Thank you for shipping our belongings to Hong Kong. &nbsp;As any move is extremely stressful, you managed to minimize that for us. Your team is sufficient and trustworthy. &nbsp;We would recommend your company to anyone that requires to move internationally. &nbsp;<br>Thank you once again for all your assistance.</p>', '2024-03-19 17:10:09', '2024-03-19 17:11:43', 0);
