INSERT INTO `ourservice` (`id`, `caption`, `description`, `image`, `alt`, `ads_image`, `ads_image_alt`, `created_at`, `updated_at`, `status`) VALUES
(1, 'Our Services', '<div class=\"subpage-main-content__col1-section\">\r\n<p>Aegis Logistics and International Moves &ndash; ALIM is a venture of experienced professionals with dedicated and well trained crew in the supply chain industry. We provide flexible end-to-end solutions that assist companies and individuals to meet their objectives by giving the best possible service at competitive prices. We are using own branded high quality packing materials and other supporting services to ensure the move stress free and affordable price.</p>\r\n</div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>Moving and Relocation</h3>\r\n\r\n<p>Our mission is to provide the best customer service and connect the people with their world, everywhere they live and work, and try do it better than anyone else.</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/moving-and-relocation.php\">More</a></div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>Warehousing</h3>\r\n\r\n<p>Do you looking for safe and secure storage? Our comprehensive storage services can accommodate all your shipment. With ALIM&rsquo;s storage solutions, items are professionally packed and stored in secure storage vaults at warehouses that meet or exceed the highest standards within the moving and storage industry.</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/warehousing.php\">More</a></div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>Logistics</h3>\r\n\r\n<p>We are one of the leading international providers of integrated logistics services in Saudi Arabia and GCC countries. We provide Air, Sea freight and in all the associated logistics services all over the world. We specialize in land transport on road as well our close link between all carriers allowing us to offer broad range of value added services.</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/logistics.php\">More</a></div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>Customs Clearance</h3>\r\n\r\n<p>Throughout the years, we have cleared a wide range of shipments, both major and minor, for an assortment of products from over the world with most extreme exactness. Being driving traditions clearing operators our master group complete a legitimate investigation of every single nearby standard and controls</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/customs-clearance.php\">More</a></div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>Office and Industrial Moving</h3>\r\n\r\n<p>We assure a budget friendly and the simplest solutions are provided to the requirements of the shoppers. Our expertise within the field are experienced in handling break-bulk shipments, wherein large quantities of supplies</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/office-and-industrial-moving.php\">More</a></div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>Furniture, Fixtures and Equipments</h3>\r\n\r\n<p>Our FF&amp;E services rendered by our team guarantee to fulfill each single want of the purchasers in constructing their dream places. Alim Arabia team takes a survey on behalf of the consumer, to seek out the most effective merchandise and resources which will facilitate in implementing the effective FF&amp;E services.</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/furniture-fixtures-and-equipments-moving.php\">More</a></div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>Sea Freight</h3>\r\n\r\n<p>We are one of the leading Sea Freight services Provides in Riyadh, Saudi Arabia. ALIM provides customized sea freight services for most types of cargo commonly moved around the world today. ALIM offers an expansive network of locations and ocean freight experience to provide you a full array of global sea freight and ocean transportation services.</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/sea-freight.php\">More</a></div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>Air Freight</h3>\r\n\r\n<p>Alim Arabia is one of the leading Air Freight services Provides in Riyadh, Saudi Arabia. Through our extensive experience network and team we have strong working relationship with reputable airlines in view to provide customers the flexibility for more frequent flight options</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/air-freight.php\">More</a></div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>GCC Transport</h3>\r\n\r\n<p>We offer a good sort of fleet that ensures a one window choice for GCC transport in Riyadh, Saudi Arabia. we tend to assist our purchasers in documentations, customs, GCC border clearances and additionally offer services in ocean, Air and Road consignment.</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/gcc-transport.php\">More</a></div>\r\n\r\n<div class=\"subpage-main-content__col1-section\">\r\n<h3>Pet Relocation</h3>\r\n\r\n<p>Aegis Logistics is a one of the best Pet Movers in Riyadh, and we offer local and international pet Relocation services in Saudi Arabia. We provides a personalized door-to-door service, carefully orchestrated to move pets safely, efficiently, and comfortably.</p>\r\n<a class=\"btn1-square\" href=\"https://alimarabia.com/logistics/pet-relocation.php\">More</a></div>\r\n', 'our-services-banner.webp', 'Our Services', 'about-ad.webp', 'Our Services', '2023-10-12 01:17:23', '2023-12-29 04:35:59', 0);
INSERT INTO `pages` (`id`, `sub_menu_id`, `caption`, `description`, `image`, `alt`, `status`) VALUES
(1, 1, 'Movers in Al-Bustan', '<p style=\"margin-left:0px;\">AEGIS offers moving services in Al Bustan. Al Bustan is a village in Al Madinah Province, in Saudi Arabia. Our team has knowledge about the routes, which helps us choose the best and shortest route to deliver your belongings and saves you time. We have all the necessary equipment and use the latest technology for a safe move, ensuring a stress-free moving experience. Our moving services involve everything from packing your belongings securely to transporting them to your new destination, and we also assist you with unpacking.</p><h3 style=\"margin-left:0px;\">Services Offered by Movers in Al Bustan</h3><h4 style=\"margin-left:0px;\">House Moving</h4><p style=\"margin-left:0px;\">AEGIS provides quality house moving services in all aspects of house moving. Our moving process includes packing and loading all your items in your house and transporting them to your destination, then unloading and unpacking the things. By calling us, you can relax and focus on your core work.</p><h4 style=\"margin-left:0px;\">Office Removal</h4><p style=\"margin-left:0px;\">We move your office safely, quickly, and efficiently. Our staff is experienced and knowledgeable in this field, so they know how to handle each item in the office. We have enough vehicles to move items and have equipment for heavy items to be moved upstairs with ease.</p><h4 style=\"margin-left:0px;\">Villa Moving</h4><p style=\"margin-left:0px;\">AEGIS\' Al Bustan Movers assists with all the important steps of moving a villa, and we also provide curtain fixing, furniture mantling, and dismantling.</p><h4 style=\"margin-left:0px;\">Furniture Moving</h4><p style=\"margin-left:0px;\">At AEGIS, we move all the furniture to your destination safely and on time. Our professionals are trained to handle the furniture moving. Staff at AEGIS are ready to move all sized and weighed furniture anywhere in your home, office, villa, etc.</p><h4 style=\"margin-left:0px;\">Packing and unpacking</h4><p style=\"margin-left:0px;\">We know the value of your belongings, and each product needs a different type of packaging. So we offer customized packing for each of your belongings. We bring packing materials for moving and storage to customers in Al Bustan.</p><h2 style=\"margin-left:0px;\">Why Do We Succeed</h2><p style=\"margin-left:0px;\"><strong>Experienced Professionals:</strong>AEGIS has trained and experienced staff to provide quality transportation services. It provides a seamless and stress-free moving experience for the client.</p><p style=\"margin-left:0px;\"><strong>On-Time Delivery:</strong>We always deliver the items on time, without any delays. Our moving process includes strategic planning and correct communication that ensures the delivery of all the items on time to your destination address without any confusion.</p><p style=\"margin-left:0px;\"><strong>Reliable and Safe:</strong>AEGIS is a reputable and trustworthy Movers in Al Bustan. We take care of your belongings with extra care and make moving an easy experience.</p>', 'movers in al busthn banner (1).webp', 'Movers in Al-Bustan', 0),
(2, 2, 'Movers in Jeddah', '<p style=\"margin-left:0cm;\"><span lang=\"EN\" dir=\"ltr\">Aegis is the best and most reputable movers in Jeddah. Moving the items fast and securely makes us a reliable moving company in Jeddah. We were in the industry years ago, and our headquarters are in Riyadh. We have branches in Jeddah and Dammam, and also provide </span><a href=\"https://alimarabia.com/logistics/moving-and-relocation.php\"><span lang=\"EN\" dir=\"ltr\"><strong>moving services all over Saudi Arabia.</strong>&nbsp;</span></a></p><p style=\"margin-left:0cm;\"><span lang=\"EN\" dir=\"ltr\">Now we are an experienced, top-priority moving company Jeddah that can handle all kinds of moving services effortlessly. Not only this but other reasons make us different from others. Whether you are moving a company or homes in Jeddah, it is better to call a moving company. They can provide complete packing, moving, installation, and </span><a href=\"https://alimarabia.com/logistics/warehousing.php\"><span lang=\"EN\" dir=\"ltr\"><strong>storage services</strong></span></a><span lang=\"EN\" dir=\"ltr\"><strong>.&nbsp;</strong></span></p><p><img src=\"../uploads/image.webp\" alt=\"Movers in Jeddah\" width=\"710\" height=\"426\"></p><h2><span style=\"font-size:16.0pt;\"><span lang=\"EN\" dir=\"ltr\"><strong>The moving services we offer are</strong></span></span></h2><ul><li><span lang=\"EN\" dir=\"ltr\">Local and domestic moving</span></li><li><span lang=\"EN\" dir=\"ltr\">International Moving</span></li><li><span lang=\"EN\" dir=\"ltr\">Pet Relocation</span></li><li><span lang=\"EN\" dir=\"ltr\">Vehicle Shipping</span></li><li><span lang=\"EN\" dir=\"ltr\">Packing and unpacking</span></li><li><span lang=\"EN\" dir=\"ltr\">Handyman and valet services</span></li><li><span lang=\"EN\" dir=\"ltr\">Warehousing&nbsp;</span></li></ul><p>&nbsp;</p><p><span style=\"font-size:13.0pt;\"><span lang=\"EN\" dir=\"ltr\"><strong>Top Reasons that Make AEGIS the Best Choice for Many Clients</strong></span></span></p><p><span lang=\"EN\" dir=\"ltr\"><strong>We meet all customer requirements</strong>&nbsp;</span></p><p><span lang=\"EN\" dir=\"ltr\">We know that building trust and loyalty is important, so we give more priority to customer satisfaction. Each customer’s requirements will be different, so meeting all those needs is quite challenging. With years of experience in this field, Aegis can handle all the complex tasks easily and deliver them on time. We provide efficient transportation, handle delicate items with care, and offer flexible scheduling.&nbsp;</span></p><p><span lang=\"EN\" dir=\"ltr\"><strong>We are ready to assist 24/7</strong></span></p><p><span lang=\"EN\" dir=\"ltr\">We are committed to providing 24/7 assistance. Whether it is during regular business hours, on the weekend, or at midnight, this availability can provide peace of mind to customers. We offer </span><span style=\"background-color:white;color:#0D0D0D;\"><span lang=\"EN\" dir=\"ltr\">flexible scheduling options to accommodate customers\' busy lifestyles and unexpected events.&nbsp;</span></span></p><p><span lang=\"EN\" dir=\"ltr\"><strong>We use high-quality packing materials</strong>&nbsp;</span></p><p><span lang=\"EN\" dir=\"ltr\">Aegis is the best packers and movers Jeddah because we only use high-quality moving materials to ensure the safety and security of your belongings during the moving process. We use sturdy boxes, packing tape, bubble wrap, packing paper, cardboard boxes, and crates. Using these materials helps to protect items from damage, minimize the risk of breakage, and ensure all your belongings safely reach the same condition.&nbsp;</span></p><p><span style=\"background-color:white;\"><span lang=\"EN\" dir=\"ltr\"><strong>We employ insured and licensed</strong></span></span></p><p><span style=\"background-color:white;\"><span lang=\"EN\" dir=\"ltr\">Having a license and insurance makes customers feel confident while hiring. It shows them that the company is reliable, honest, and does things the right way. We have a license, which means we\'re officially allowed to do moving jobs. And we also provide insurance, so if anything gets damaged during the move, you\'re covered. Having these things shows how much we give importance to your belongings and that you can trust us to take care of them.</span></span></p><p><span style=\"background-color:white;\"><span lang=\"EN\" dir=\"ltr\"><strong>Stress-free moving</strong></span></span></p><p><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\">Moving is always tough when thinking of a list of tasks like packing and unpacking, furniture mantling and rejoining, organizing, transportation, and more. When you choose Aegis, you can sit back and experience stress-free movement by handing over all your moving tasks.&nbsp;</span></span></p><p><img src=\"../uploads/movers jeddah.webp\" alt=\"jeddah movers\" width=\"709\" height=\"399\"></p><p><span style=\"background-color:white;color:#333333;font-size:14.0pt;\"><span lang=\"EN\" dir=\"ltr\"><strong>Benefits of hiring Aegis for moving in Jeddah</strong></span></span></p><p><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\"><strong>We have enough tools and vehicles</strong></span></span></p><p><span style=\"background-color:white;color:#1F1F1F;\"><span lang=\"EN\" dir=\"ltr\">Aegis understands that moving to any location can be a stressful experience. That\'s why we\'re here to make the process as smooth and efficient as possible. We are a fully equipped moving company in Jeddah, with a fleet of well-maintained vehicles and all the necessary tools to handle your belongings with care. Our experienced and dedicated team will ensure your furniture, boxes, and valuables are safely transported to your new destination, giving you peace of mind during this important transition.</span></span></p><p><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\"><strong>We know all the local roots</strong></span></span></p><p><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\">Our professional team knows the city well and its local and short roots. This helps us reach the destination in a short period of time and avoid delays. This is also the main reason that Jeddah residents choose Aegis to relocate faster and more smoothly.&nbsp;</span></span></p><p><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\"><strong>We communicate throughout the process</strong></span></span></p><p><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\">Our expert team communicates with the client from the initial stage.&nbsp;</span></span><span style=\"background-color:white;color:#1F1F1F;\"><span lang=\"EN\" dir=\"ltr\">At every stage of your move, we\'ll provide clear and consistent communication. From initial estimates to final delivery, you\'ll receive regular updates and have a dedicated point of contact to answer any questions you may have.</span></span></p><p><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\"><strong>We offer transparent pricing</strong></span></span></p><p><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\">At Aegis, we offer transparent pricing; we have no&nbsp;</span></span><span style=\"background-color:white;color:#1F1F1F;\"><span lang=\"EN\" dir=\"ltr\">hidden fees or surprises.</span></span><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\">&nbsp;</span></span><span style=\"background-color:white;color:#1F1F1F;\"><span lang=\"EN\" dir=\"ltr\">Honest pricing builds trust.</span></span></p><p><span style=\"background-color:white;color:#333333;\"><span lang=\"EN\" dir=\"ltr\"><strong>Our first step is to plan the moving</strong></span></span></p><p><span style=\"background-color:white;color:#1F1F1F;\"><span lang=\"EN\" dir=\"ltr\">We\'ll work closely with you to understand your needs and create a personalized moving plan for a smooth transition. Considering the client\'s varied needs and identifying items requiring special care, planning is very important.</span></span></p><p><span style=\"background-color:white;color:#1F1F1F;\"><span lang=\"EN\" dir=\"ltr\">These factors make us the most reliable movers in Jeddah. There are many moving companies in Jeddah, but moving swiftly and delivering on time is important. Aegis knows the value of customers\' time and their belongings. They move the item carefully and on time. We always meet the customer\'s requirements; this is the key to becoming successful movers and packers in Jeddah.&nbsp;</span></span></p>', 'friendly-delivery.webp', 'Movers in Jeddah', 0),
(4, 5, 'How much does a moving company in Riyadh cost for moving services?', '<p>hi</p>', 'professional-movers-doing-home-relocation-high-quality-ai-generative.jpg', 'move', 2),
