(7, 'Sea Freight', '<h2>Leading Sea Freight service providers in KSA</h2><p>We are one of the leading sea freight service providers in Riyadh, Saudi Arabia. ALIM provides customized sea freight services for most types of cargo commonly moved around the world today. ALIM offers an expansive network of locations and ocean freight experience to provide you with a full array of global sea freight and ocean transportation services. From less-than-container loads to full container loads, special equipment, and enormous freight, we can handle shipments of nearly any size. To handle your maritime freight services globally, you may rely on a single provider.</p><p><img src=\"../uploads/sea freight service.webp\" width=\"710\" height=\"330\" alt=\"Sea Freight service \"></p><h3>We offers</h3><p>•&nbsp;&nbsp; &nbsp;Vessel charters<br>•&nbsp;&nbsp; &nbsp;Cargo/customs clearance and brokerage for export &amp; import consignment<br>•&nbsp;&nbsp; &nbsp;Consolidation services<br>•&nbsp;&nbsp; &nbsp;Vessel clearance and husbandry<br>•&nbsp;&nbsp; &nbsp;Transshipment services<br>•&nbsp;&nbsp; &nbsp;Freight management services<br>•&nbsp;&nbsp; &nbsp;Full container load (FCL)<br>•&nbsp;&nbsp; &nbsp;Less than container load (LCL)<br>•&nbsp;&nbsp; &nbsp;Break bulk cargo<br>•&nbsp;&nbsp; &nbsp;Cargo/marine insurance services</p><h3>Benefits of Choosing AEGIS Sea Freight Services</h3><p><strong>Cost-effective:</strong> Compared to other freight methods, sea freight is a cheaper method. When transporting heavy goods, it is the best and six to ten times cheaper option than other freight, like air freight. Because it uses large vessels to transport larger goods over long distances. We can take multiple cargos when the trade routes of these clients coincide. This also reduces costs for those clients.</p><p><strong>Environment-friendly:</strong> It consumes less fuel than other transportation modes, and it is the most carbon-efficient option. The carbon emissions from ships are only 2.7% of those from air freight. This makes sea freight more eco-friendly than other shipping methods.</p><p><strong>Best for heavy cargo:</strong> Heavy cargo, like large vehicles, equipment, machinery, and construction materials, can be easily transported by sea, which can\'t be transported by air freight. Sea freight shipping at AEGIS can accommodate whatever the size of your shipments.</p><p><strong>Safe Transportation:</strong> It is designed to carry dangerous sea freight cargo safely and securely. We pack everything well and lock it for more security. Our team is well trained in handling these kinds of goods.</p><p><strong>LCL and FCL:</strong> We offer LCL (less than container load) and FCL (full container load) features in our sea cargo service for your goods. LCL is good for goods that are too small to fill the shared container, and FCL is good for goods that fill the entire container, so your bulky goods will be transported in a separate container.</p><p><img src=\"../uploads/freight shipping service.webp\" width=\"710\" height=\"398\" alt=\"Freight shipping service  \"></p><h3>Highlights of Our Sea Freight Forwarding Services</h3><p><strong>Accurate and Safe:</strong> Our team inspects all your shipments and labels them with the destination address and the type of goods; this ensures accurate and safe delivery.<br>Relationship with clients: We maintain good relationships with clients. As a reputable sea freight forwarder with exceptional customer service, we ensure safe and on-time delivery.</p><p><strong>All industry sectors: </strong>AEGIS provides sea freight services for all types of industries, like FMCG, lifestyle, retail, chemicals, automotive, electronics, and large-sized cargo.</p><p><strong>Quality and Efficiency: </strong>With extensive industry knowledge and using cutting-edge technology, AEGIS offers transportation with accurate quality and efficiency worldwide.</p><p><strong>Insurance:</strong> We provide insurance services for all your shipments.</p><p><strong>Handling dangerous goods:</strong> We handle dangerous and sensitive goods in specially designed containers.</p><p>Consider ALIM for the best sea cargo transportation services. We provide all logistic services, like freight forwarding, we safely pack your belongings. Our services extend all over the world by having branches in Riyadh, Jeddah, and Dammam.&nbsp;</p>', 'We are one of the leading sea freight service providers in Riyadh, Saudi Arabia. ', 'sea-freight-banner.webp', 'Sea Freight', 'sea-freight.php', '2023-10-07 05:14:36', '2024-03-12 08:22:35', 0),
(8, 'Air Freight', '<h2><span style=\"font-size:20px;\">Strong Working Relationships With Reputable Airlines</span></h2><p>ALIM ARABIA is one of the leading Air cargo Freight services providers in Riyadh, Saudi Arabia. Through our extensive experience network and team, we have strong working relationships with reputable airlines in view of providing customers with the flexibility for more frequent flight options, additional cargo space, and a reliable schedule. Our commitment ensures speed and consistently high service levels for an enhanced travel experience. Our branch is situated in both Dammam and Jeddah and provides our services all over Saudi Arabia.</p><p><img src=\"/uploads/images/air%20cargo.jpg\" alt=\"\" width=\"655\" height=\"250\"></p><h3>We offers</h3><ul><li>Next Flight Out</li><li>Overnight Freight Service</li><li>Competitive deferred Air Freight Service</li><li>Time-Definite Express Service</li><li>Consolidation and Direct-to-Consignee Service</li><li>Door-to-Door and Airport-to-Airport Service&nbsp;&nbsp;</li></ul><p>&nbsp;</p><h3>Types of Air Cargo Saudi Arabia Offered by AEGIS</h3><p><strong>1. General Air Cargo</strong><br>General air cargo is typically priced lower than special cargo. Because it has no special features like temperature control, fast movement, etc.</p><p>These kinds of planes do not carry passengers; they can handle large and heavy goods. Books, clothes, computers, and their parts are generally transported by using this service. AEGIS provides safe and secure general air cargo service in Riyadh, Saudi Arabia.</p><p><strong>2. Special Air Cargo</strong><br>Special air cargo means there are some items that need extra care during transport. We can transport these items only in special cargo. The price of this cargo is higher than the general cargo because it has special features.</p><p>When choosing a special cargo, you should choose a reputable service provider who has a proven track record. With our years of experience in this industry, we offer only quality services for our clients. Let us see what is included in our special cargo service in Riyadh, Saudi Arabia.</p><p><img src=\"/uploads/images/air%20cargo%20loading.jpg\" alt=\"\" width=\"655\" height=\"250\"></p><p><strong>Temperature Controlled:</strong> This is used for items that need to be stored at a controlled temperature, like medical kits, fruits, vegetables, human organs and tissues, etc. As you all know, when transporting a human organ, it needs special packaging, should reach the scheduled time, and also requires temperature controls.</p><p><strong>Passenger Aircraft</strong>: Passenger aircraft are good for transporting small goods. Depending on the kind of flight, there are weight, type, and size restrictions. Passenger aircraft prioritize first the passengers and their luggage, followed by courier shipments, and lastly the cargo goods.</p><p><strong>Dangerous/Hazardous Cargo:</strong> The goods in this category are flammable, poisonous, and explosive. It should be properly packed and handled with care.</p><p>&nbsp;<strong>Live Animals:</strong> In this type of cargo service, we normally carry live animals like dogs, cats, birds, etc. When transporting live animals, place them in a comfortable, safe, and ventilated crate.</p><p><strong>3. Air Charter</strong><br>For transporting goods to a country, this is the fastest delivery method. This method is usually used for urgent transport in the mining and automotive industries. With a commitment to safety and transparent pricing, we prioritize the seamless transport of your goods. &nbsp;Elevate your supply chain with our trusted air charter service, delivering excellence in cargo logistics for businesses internationally.<br>&nbsp;</p><h2>Why Choose Our Air Freight Services&nbsp;</h2><p><strong>Unmatched Speed: </strong>We know the importance of time-sensitive shipments, so we ensure your goods reach their destination promptly.</p><p><strong>Cutting-Edge Technology: </strong>AEGIS offers the latest innovations to streamline processes and enhance your shipping experience. Our professionals are trained in the latest technology and experienced enough to handle your goods.</p><p><strong>Customer service: </strong>We always prioritize the satisfaction of our customers. Our team is ready to support you at every step and ensures that we meet all customer requirements.</p><p><strong>Insurance: </strong>At AEGIS, we offer insurance options for client’s peace of mind if any damage occurs to their belongings.</p><p><strong>Door-to-Door Service:</strong> We pick up your freight at the sender’s doorstep and deliver it to the recipient’s door.<br>&nbsp;</p>', 'ALIM ARABIA is one of the leading Air cargo Freight services providers in Riyadh, Saudi Arabia. ', 'air-freight-banner.webp', 'Air Freight', 'air-freight.php', '2023-10-07 05:16:53', '2024-02-22 05:19:36', 0),
(9, 'GCC Transport', '<p>We offer a good sort of fleet that ensures a one-window choice for GCC transport in Riyadh, Saudi Arabia. We tend to assist our purchasers in documentation, customs, and GCC border clearances, and additionally, we offer services in ocean, air, and road consignments. GPS trailing offers wonderful visibility to our purchasers on the status of their shipments all around the region.</p><h3>&nbsp;</h3><h3>Tie-ups with all GCC Native Transport Operators</h3><p>We operate our own fleet of vehicles and have wonderful tie-ups with all GCC-native transport operators. To keep in line with our specialization in being a one-stop supply hub for logistics, we understand the importance of the safe handling and timely delivery of shipments and that we provide optimum solutions in terms of speed, routing, and the kinds of hundreds carried.</p><ul><li>Moving and Storage Services</li><li>International Moving</li><li>Storage</li><li>Pet Relocation</li><li>Vehicle Shipping</li><li>Insurance Coverage</li><li>Handyman &amp; Valet Services</li></ul><h2>&nbsp;</h2><h2>Our GCC Transportation Services&nbsp;</h2><p><strong>Domestic Transport:</strong> AEGIS facilitates a quick and efficient GCC transportation solution for your goods within the GCC countries. Our extensive network and partnerships ensure that we meet the unique requirements of your business. We don\'t have any minimum load restrictions for domestic transportation. Our experienced team delivers all your belongings to their destination fast and on time.&nbsp;</p><p><strong>International Freigh</strong>t: At AEGIS, we offer international freight services and ensure smooth transportation. We handle all documentation, customs clearance, and GCC border clearance. Our team will take care of your goods and offer safe transportation worldwide. We provide a variety of transportation options, including trucks, trains, ships, and airplanes, to get around geographical obstacles. When transporting goods to different countries, you should consider the risk of damage and missing goods. So it requires insurance management. AEGIS provides insurance coverage for all international freight services.&nbsp;</p><p><strong>Logistics and Warehousing:</strong> Efficient logistics and warehousing are integral parts of successful transportation. Our GCC Transport offers state-of-the-art facilities for storage, inventory management, and distribution, enhancing the overall efficiency of your supply chain. We have branch offices in Dammam and Jeddah to provide the best GCC transportation services.</p><p><strong>Specialized Transport:</strong> Certain goods need to be handled carefully. Whether your items are perishable, fragile, or enormous, our customized shipping services and trained teams are designed to fulfill their specific needs. Additionally, we offer packing&nbsp;and storing your goods according to their type.</p><p>&nbsp;</p><h3>Reasons to Choose Our GCC Transportation</h3><p><strong>Customer-Centric Approach:</strong> We give top priority to customer satisfaction. Our team is available 24 hours a day to assist you with your GCC transportation.</p><p><strong>Global Network: </strong>GCC Transport guarantees that your goods reach their destination without any problems, wherever on the globe they may be, thanks to a strong global network.</p><p><strong>Competitive Pricing: </strong>Pricing depends on the volume of goods, the type of goods, and the type of transportation. But AEGIS always offers affordable prices for your GCC transportation.</p><p>AEGIS manages complete GCC transportation and ensures hassle-free movement. Experience comprehensive services that elevate supply chain efficiency, positioning AEGIS as a trusted partner in regional trade.</p>', 'We offer a good sort of fleet that ensures a one-window choice for GCC transport in Riyadh, Saudi Arabia. ', 'gcc-transport-banner.webp', 'GCC Transport', 'gcc-transport.php', '2023-10-07 05:18:08', '2024-02-10 11:02:46', 0);
