(1, 1, 'Gary Sakamaki', 'Saudi Arabia to Thailand', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">I had a shipment of household items sent from Ras Tanura, Saudi Arabia, to Chantaburi, Thailand.. The group from Aegis were great. They came to take a look for an estimate. Gave me shipping dates and estimates. It was a little worrying, because the Jeddah port was closed, due to military things going on in the Red Sea. We got another quote leaving Dammam, on the Eastern side, which is still open.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">The group of guys came to the house snd started packing. After three days, they had packed up a 40 ft container and sealed it up for shipment. They were courteous and had good hygiene habits.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">I would recommend them for anyone deciding to ship from Saudi Arabia to any place in thd world.</span></p>', '2024-02-28 07:41:14', '2024-05-13 05:24:56', 0),
(2, 1, 'Marium masood', 'KSA to UAE', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">Aegis team had done the wonderful work they are very professional and helpful. ksa to UAE cargo is so fast that we can\'t even imagine.. thanks you Team</span></p>', '2024-02-28 07:42:05', '2024-05-13 05:31:04', 0),
(3, 1, 'Eric Niborg', 'Riyadh to Usa', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I had a great experience with this company. Account manager extremely customer service oriented and professional. Straight quotation all inclusive with no gimmicks. Exactly on time service and very accommodating of my schedule, working the weekend and evening. The crew very experienced, careful, professional and courteous. Al my goods arrived 100% undamaged. Highly recommend!</span></p>', '2024-02-28 07:43:37', '2024-02-29 06:06:51', 2),
(4, 1, 'Taha khan', 'Riyadh to Al Khobar', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(31,31,31);font-family:&quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;font-size:13px;\">We hired Aegis Logistics to transport our household belongings from Riyadh to Al Khobar, and their service was outstanding. They were highly professional, with excellent communication throughout the process. The team was not only helpful but also very careful in handling our items, including fragile ones.</span></p>', '2024-02-28 07:44:29', '2024-11-20 05:22:12', 0),
(5, 1, 'Dr. Umar Farouqi', 'Riyad to Bahrain', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Had to shift from saudi to Kingdom of Bahrain</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Found Aegis Logistics as most professional and consumer friendly company.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Highly recommended for m@p services.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Mr Nizam from saudi and Mr Jose from bahrain were particularly helpful.</span></p>', '2024-02-28 07:44:56', '2024-02-29 05:39:55', 2),
(6, 1, 'Mr. Sanjay Thakur', 'Jeddah to Riyadh', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Amazing, professional and very Helpful staff.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Had one of the best and hassle free experience.</span></p>', '2024-02-28 07:45:18', '2024-02-29 06:06:58', 2),
(7, 1, 'Ms. María Calvente Aldea', 'Riyadh to Spain', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Very professional team, all my items are perfect. Nothing lost. The team in saudi and the team in Spain very helpful and professional. I highly recommend this company. Good price comparing with others companies.</span></p>', '2024-02-28 07:45:42', '2024-02-29 06:06:36', 2),
(8, 1, 'Mr. Maysan AlShaar', 'Riyadh to Usa', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Very professional, hard working, available for questions or concerns</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Furniture received in the best way</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I highly recommend this company</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">A very successful experience and their prices are reasonable</span></p>', '2024-02-28 07:46:22', '2024-02-29 06:06:46', 2),
(9, 1, 'Mark Allchin', 'Saudi Arabia To Kenya', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I would like to thank amazing team at Aegis Logistics for an excellent service in moving my household goods abroad.</span></p>', '2024-02-28 07:46:44', '2024-02-29 06:06:41', 2),
(10, 1, 'Dr Rafay Iqbal', 'Riyadh to Karachi', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">The shipment arrived well in time, before I start my job next week. The cargo was handled very professionally by you and Karachi counterpart as well.</span></p>', '2024-02-28 07:47:10', '2024-02-29 06:08:03', 2),
(11, 1, 'Altaher Aljamal', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">A very professional team that could take care of all your needs when you are moving into a new location in Riyadh. The team is punctual, professional, well-organized, and friendly in an unbelievable way. I explained what my requirements were, and they honestly exceeded my expectations. Two thumbs very well done!</span></p>', '2024-02-28 07:47:39', '2024-05-13 05:34:39', 0),
(12, 1, 'Shakil Mujawar', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">My shipment was picked up.today and everything went off very well. It was very professional and I appreciate it a lot. Thx for the very fluent support.</span></p>', '2024-02-28 07:47:56', '2024-02-29 06:05:57', 2),
(13, 1, 'Kinda Helmi', 'UAE to KSA', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Team Saudi Arabia was very professional and accomodating . Thanks you very much.</span></p>', '2024-02-28 07:48:16', '2024-02-29 06:05:52', 2),
(14, 1, 'Ekram Kofiah', 'Riyadh to Dubai', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">I recently hired Aegis Logistics and International Movers for my move, and I couldn\'t be happier. Their professionalism is unmatched – they took exceptional care of my furniture, displaying a level of attention and care that truly sets them apart. Trustworthy and reliable, I highly recommend their services for a stress-free moving experience.</span></p>', '2024-02-28 07:48:42', '2024-03-01 09:30:18', 0),
(15, 1, 'Mr. Kiriakose Skarpas', 'Riyadh to Greece', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">The team arrived on time. Equiped with all necessary tools and knowing exactly their job. Tottaly very professional service.</span></p>', '2024-02-28 07:49:04', '2024-02-29 06:04:53', 2),
(16, 1, 'Mr. Norman J Leite', 'Saudi Arabia to Bahrain', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">No issue at all and thank you Riyas, and also thank you for your prompt and efficient service.</span></p>', '2024-02-28 07:49:26', '2024-02-29 06:04:30', 2),
(17, 1, 'Mrs. Sarah Basrawi', 'Jeddah to Riyad', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Services provided at origin and destination such as the quality of packing,labeling , organization and attitude of crew was excellent . keep it up</span></p>', '2024-02-28 07:49:46', '2024-02-29 06:04:25', 2),
(18, 1, 'Mr. Abdul rahiman', 'Riyadh to Turkey', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I was really impressed with level of professionalism that the team has shown...Certainly i will recommend the services to others</span></p>', '2024-02-28 07:50:07', '2024-02-29 06:04:35', 2),
(19, 1, 'Mr. Atikan Teber', 'Riyadh to USA', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I would like acknowledge the exceptionally great service received from your guys on packing our belongings. I will definitely recommend your company to my friends and colleagues.</span></p>', '2024-02-28 07:50:27', '2024-02-29 06:04:48', 2),
(20, 1, 'Ms.Farah Zafar', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I wanted to thank you and your team for doing a great job. We both received our goods in Dubai and were very happy with the service.</span></p>', '2024-02-28 07:50:42', '2024-02-29 05:40:48', 2),
