(22, 1, 'Mohammad Ansari', 'Saudi Arabia to India', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">On Behalf of Mubashira, would love to take an opportunity to thank Aegis Logistics &amp; Int\'l movers for variety professional services of pickup,loading, coordinate and email exchange.</span></p>', '2024-02-28 07:51:32', '2024-02-29 06:04:44', 2),
