(87, 4, 'Kristine Kerr', 'Oakland, New Zealand', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">A somewhat belated thank you very much for your excellent service. I was both pleased and impressed with your company’s efficiency, attention to detail and prompt responses</span></p>', '2024-02-28 02:20:59', '2024-02-29 06:15:46', 2),
(88, 4, 'maria calvente', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">Very professional team, all my items are perfect. Nothing lost. The team in saudi and the team in Spain very helpful and professional. I highly recommend this company. Good price comparing with others companies.</span></p>', '2024-02-28 02:21:32', '2024-05-13 08:54:38', 0),
