(216, 8, 'Mr. Abdul rahiman', 'Riyadh to Turkey', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I was really impressed with level of professionalism that the team has shown...Certainly i will recommend the services to others</span></p>', '2024-02-28 02:20:07', '2024-02-29 05:45:53', 2),
