(218, 8, 'Ms.Farah Zafar', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I wanted to thank you and your team for doing a great job. We both received our goods in Dubai and were very happy with the service.</span></p>', '2024-02-28 02:20:42', '2024-02-29 05:45:32', 2),
(219, 8, 'Andrew', 'Ali Hafez', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">I recently had the pleasure of using the services of Aegis logistics to handle the shipping of my furniture, and I must say they did an outstanding job! From start to finish, their level of professionalism was commendable.</span><br><br><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">The team at Aegis Logistics demonstrated exceptional expertise in dismantling and packaging my furniture items securely for the journey. I was impressed by their attention to detail and the care they took to ensure everything was well-protected.</span><br><br><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">The shipping process itself was smooth and efficient. They kept me informed throughout the transit, and my furniture arrived at its destination in perfect condition and right on schedule. It was evident that they prioritized customer satisfaction and took great pride in their work.</span><br><br><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">After the shipment reached its destination, the team skillfully reassembled the furniture, leaving me with a stress-free experience. They were courteous and attentive, making sure everything was in place and functioning correctly.</span><br><br><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">I can not thank Aegis logistics enough for their hard work and dedication. They made what could have been a stressful moving process into a seamless and hassle-free experience. I highly recommend their services to anyone in need of professional furniture shipping.</span><br><br><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">Once again, a big thank you to the entire team at Aegis Logistics . Keep up the fantastic work!</span></p>', '2024-02-28 02:20:59', '2024-05-13 07:16:47', 0),
