(225, 9, 'Dr. Umar Farouqi', 'Riyad to Bahrain', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Had to shift from saudi to Kingdom of Bahrain</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Found Aegis Logistics as most professional and consumer friendly company.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Highly recommended for m@p services.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Mr Nizam from saudi and Mr Jose from bahrain were particularly helpful.</span></p>', '2024-02-28 07:44:56', '2024-02-29 05:42:05', 2),
(226, 9, 'Mr. Sanjay Thakur', 'Jeddah to Riyadh', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Amazing, professional and very Helpful staff.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Had one of the best and hassle free experience.</span></p>', '2024-02-28 07:45:18', '2024-02-29 05:42:11', 2),
