(264, 10, 'Emilio Moucarry', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">Great and efficient work</span></p>', '2024-02-28 02:21:32', '2024-05-13 09:20:11', 0),
(265, 8, 'Benjamin Wessendorf', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">Excellent Service. Highly recommended. Well trained, polite and professional team and Management. 5 star rating well deserved!!!</span></p>', '2024-03-13 10:25:37', '2024-05-13 07:17:26', 0),
(266, 1, 'Matias Vaira, PhD | Director of Economics', 'PIF -  Real Estate Assets Management', '<p>My family of four moved from Riyadh KSA to regional NSW, Sydney Australia. I would highly recommend this service for their professional and efficiency.&nbsp;The team in Riyadh packed our things with care and courtesy and they were polite. The team from Sydney also made relocation easier with efficiency and good manners. They showed initiative and care with unloading and unpacking. I would highly recommend this service.<br>&nbsp;</p>', '2024-03-18 07:15:24', '2024-11-20 05:23:19', 0),
(267, 1, 'Kotie Meyer', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">Dear team Thank you for shipping our belongings to Hong Kong. As any move is extremely stressful, you managed to minimize that for us. Your team is sufficient and trustworthy. We would recommend your company to anyone that requires to move internationally.Thank you once again for all your assistance.With many thanks.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">The Meyer family</span></p>', '2024-03-20 04:13:23', '2024-11-20 05:35:07', 0),
(268, 10, 'Dr Lewis', 'Riyadh to London', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(31,31,31);font-family:arial, sans-serif;font-size:13px;\">Superb service, pet transfer and travel arrangements that was well Delivered. Thank you for all the team, outstanding service. My cookie dog arrived safely and she was well cared for. Riyadh to London transfer successfully done.</span></p>', '2024-04-30 06:15:33', '2024-04-30 06:15:33', 0),
(269, 1, 'Paul Atkinson', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(31,31,31);font-family:&quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;font-size:13px;\">Excellent service from start to finish. The estimator that came was very precise in his estimate of the square footage we wanted to ship. The packing guys were brilliant, efficient, helpful, well mannered and generally all round good people. Our shipment has arrived at our new home. Very happy clients. Highly recommend</span></p>', '2024-11-20 05:17:20', '2024-11-20 05:37:10', 0),
(270, 3, 'Naveen Ponnam', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(60,64,67);font-family:Roboto, Arial, sans-serif;font-size:14px;\">I highly recommend Aegis Logistics for their exceptional service at the Bupa facility. After the challenging task of moving our beloved office in Riyadh to our new building in KAFD, I can honestly say that working with them was a remarkable experience. Their professional team truly went above and beyond to take care of our stuff, and their communication made a potentially stressful situation so much easier to navigate.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(60,64,67);font-family:Roboto, Arial, sans-serif;font-size:14px;\">I\'m grateful for their support throughout this transition.</span></p>', '2025-03-20 05:59:51', '2025-03-20 05:59:51', 0),
(271, 3, 'Monica Santos', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(60,64,67);font-family:Roboto, Arial, sans-serif;font-size:14px;\">Our move from Dubai to Riyadh couldn\'t have gone smoother thanks to Aegis. They handled every step professionally from answering all my questions, packing up my belongings and delivering everything at destination. The team at origin were especially careful in packing up my things, polite and overall hard workers. Nisam\'s team at destination coordinated customs and delivery without any issues, worked quickly and were very respectful. It was a 5 star experience and I\'m glad i went with Aegis!</span></p>', '2025-03-20 06:02:00', '2025-03-20 06:02:00', 0);
