INSERT INTO `sub_pages_faq` (`id`, `sub_menu_id`, `caption`, `description`, `status`) VALUES
(1, 1, 'What is the price of moving services in Al Bustan?', '<p>The price of the moving services may vary; the average price of the item is determined after every acquisition.</p>', 0),
(2, 1, 'How long do movers take to pack?', '<p>The time taken to move your items depends upon the size of your home or office; bigger homes take more time. Generally, experienced packers like AEGIS can pack all the belongings in your home within a day or two.</p>', 0),
(3, 1, 'Do you provide insurance for moving?', '<p>Yes, AEGIS provides insurance for all types of moving services to cover the risk of damages during the moving process.</p>', 0),
(4, 1, 'Do you provide assistance for moving only a single-piece item?', '<p>Yes, we provide services for moving single-piece items.</p>', 0),
(5, 2, 'Do you provide international home shifting services from Jeddah?', '<p><span style=\"background-color:white;color:#0D0D0D;font-family:Roboto;font-size:12.0pt;\"><span lang=\"EN\" dir=\"ltr\">Yes, many home shifting companies in Jeddah offer international relocation services.&nbsp;</span></span></p>', 0),
(6, 2, 'Did you provide storage service, and how long can we store our belongings?', '<p><span style=\"background-color:white;color:#1F1F1F;\"><span lang=\"EN\" dir=\"ltr\">Yes, Aegis provides a complete storage service that safeguards your belongings.&nbsp;</span></span><span style=\"background-color:white;color:#1F1F1F;font-family:Roboto;\"><span lang=\"EN\" dir=\"ltr\">The duration can be adjusted based on the specific needs and agreements with the clients.&nbsp;</span></span></p>', 0),
(7, 2, 'Is international moving expensive?', '<p><span style=\"background-color:white;color:#1F1F1F;font-family:Roboto;\"><span lang=\"EN\" dir=\"ltr\">Yes, but the cost of international moving will vary according to factors such as distance, transportation costs, customs duties, and other associated fees.&nbsp;</span></span></p>', 0),
(8, 2, 'Is moving insurance necessary in Jeddah?', '<p><span style=\"background-color:white;color:#0D0D0D;font-family:Roboto;font-size:12.0pt;\"><span lang=\"EN\" dir=\"ltr\">Yes, moving insurance is advisable in Jeddah, as it is in any other location, to protect your belongings during the moving process.</span></span></p>', 0),
(9, 2, 'Are there any items that you cannot move?', '<p><span style=\"background-color:white;color:#252525;font-size:12.0pt;\"><span lang=\"EN\" dir=\"ltr\">Aegis moves all your belongings, but there are certain items that moving companies may not be able to transport due to safety, legal, or logistical reasons. These items typically include hazardous materials such as explosives, flammable liquids, corrosive substances, and perishable items like food.&nbsp;</span></span></p>', 0),
(10, 3, 'Is it cheaper to move things within Khobar?', '<p><span lang=\"EN\" dir=\"ltr\">Yes, the cost of moving depends on the size of your belongings, the distance from your location to a new one, and also the special requirements. So you can expect a little less in overall moving costs. AEGIS offers a competitive price for any moving service.&nbsp;</span></p>', 0),
(11, 3, 'How to choose the best movers and packers in Khobar?', '<p><span lang=\"EN\" dir=\"ltr\">Choosing the best packers and movers is difficult. There are many factors to consider when choosing the best moving service company, including transparent pricing, on-time delivery, insurance coverage, checking customer reviews, and comparing quotes.</span></p>', 0),
(12, 3, 'What is the importance of hiring professional packers and movers in Dammam?', '<p><span lang=\"EN\" dir=\"ltr\">When you are relocating, it is difficult to pack everything on your own in the busy time of moving. You need to arrange trucks, and sometimes you can’t handle heavy items yourself. In this situation, it is advisable to hire professional packers and movers.</span></p>', 0),
(13, 3, 'What does a home shifting service include?', '<p><span style=\"background-color:transparent;color:#333333;font-family:Arial,sans-serif;font-size:12pt;\">Our house shifting Khobar services include careful packing-unpacking, loading-unloading, safe transportation, and clean storage services.</span></p>', 0);
INSERT INTO `sub_pages_testimonial` (`id`, `sub_menu_id`, `name`, `location`, `comment`, `created_at`, `updated_at`, `status`) VALUES
(1, 1, 'Benjamin Wessendorf', 'Riyadh, KSA', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Excellent Service. Highly recommended. Well trained, polite and professional team and Management. 5 star rating well deserved!!!</span></p>', '2024-02-28 13:11:14', '2024-03-01 09:14:18', 2),
(2, 1, 'Mr. Bilal Ahmed', 'Riyadh to UK', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I used them for relocating from Riyadh to London.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">They have a very professional team.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I would really appreciate Mr. Nisam who have been supportive throughout the whole process.</span></p>', '2024-02-28 13:12:05', '2024-03-01 09:14:21', 2),
(3, 1, 'Eric Niborg', 'Riyadh to Usa', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I had a great experience with this company. Account manager extremely customer service oriented and professional. Straight quotation all inclusive with no gimmicks. Exactly on time service and very accommodating of my schedule, working the weekend and evening. The crew very experienced, careful, professional and courteous. Al my goods arrived 100% undamaged. Highly recommend!</span></p>', '2024-02-28 13:13:37', '2024-02-28 13:13:37', 0),
(4, 1, 'Jacqueline Newton', 'Dammam to UK', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">The logistics company were great very professional very quick, and the quote was much less than other companies. The shipment arrived safe and quickly. The staff are excellent I would recommend using</span></p>', '2024-02-28 13:14:29', '2024-03-01 09:14:12', 2),
(5, 1, 'Dr. Umar Farouqi', 'Riyad to Bahrain', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Had to shift from saudi to Kingdom of Bahrain</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Found Aegis Logistics as most professional and consumer friendly company.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Highly recommended for m@p services.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Mr Nizam from saudi and Mr Jose from bahrain were particularly helpful.</span></p>', '2024-02-28 13:14:56', '2024-03-01 09:14:35', 2),
(6, 1, 'Mr. Sanjay Thakur', 'Jeddah to Riyadh', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Amazing, professional and very Helpful staff.</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Had one of the best and hassle free experience.</span></p>', '2024-02-28 13:15:18', '2024-03-01 09:14:15', 2),
(7, 1, 'Ms. María Calvente Aldea', 'Riyadh to Spain', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Very professional team, all my items are perfect. Nothing lost. The team in saudi and the team in Spain very helpful and professional. I highly recommend this company. Good price comparing with others companies.</span></p>', '2024-02-28 13:15:42', '2024-03-01 09:14:39', 2),
(8, 1, 'Mr. Maysan AlShaar', 'Riyadh to Usa', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Very professional, hard working, available for questions or concerns</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Furniture received in the best way</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I highly recommend this company</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">A very successful experience and their prices are reasonable</span></p>', '2024-02-28 13:16:22', '2024-03-01 09:14:23', 2),
(9, 1, 'Mark Allchin', 'Saudi Arabia To Kenya', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I would like to thank amazing team at Aegis Logistics for an excellent service in moving my household goods abroad.</span></p>', '2024-02-28 13:16:44', '2024-03-01 09:14:07', 2),
