(11, 1, 'Mr. Junaid Ali', 'Jeddah to Khobar ( Saudi Arabia )', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">Many thanks for delivering an exceptional service. The teams were extremely professional and committed. They carried out their duties with utmost care and responsibility. I was completely satisfied</span></p>', '2024-02-28 13:17:39', '2024-02-28 13:17:39', 0),
