(21, 1, 'Anton van Deventer', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">I want to thank the team he sent to pack my goods. They went about in a professional way and my goods arrived safely at my house in South Africa. Excellent service and communication throughout the trip. Thank you very much. You are the best!</span></p>', '2024-02-28 13:20:59', '2024-05-13 09:32:27', 0),
