(39, 2, 'Ahmed Elgazzar', 'Saudi Arabia To Spain', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">The crew is very professional and capable, they got the job done perfectly, in very reasonable time and quietly. I will highly recommended the company for handling moving tasks.</span></p>', '2024-02-28 07:49:46', '2024-05-13 09:29:52', 0),
(40, 2, 'Mr. Abdul rahiman', 'Riyadh to Turkey', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I was really impressed with level of professionalism that the team has shown...Certainly i will recommend the services to others</span></p>', '2024-02-28 07:50:07', '2024-03-01 09:13:51', 2),
(41, 2, 'Mr. Atikan Teber', 'Riyadh to USA', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">I would like acknowledge the exceptionally great service received from your guys on packing our belongings. I will definitely recommend your company to my friends and colleagues.</span></p>', '2024-02-28 07:50:27', '2024-03-01 09:13:59', 2),
(42, 2, 'Toseef Ahmed', 'Riyadh to Islamabad ', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">I had a great experience with Aegis. I shipped my household items from Riyadh to Islamabad Pakistan and received all items without any damage. The team in Riyadh was very professional and packed all items and placed in container very carefully. The team in Pakistan was also very diligent and handled all the paperwork and off loaded my items carefully from the container and placed in my house as per our instructions. Thanks for providing excellent service.</span></p>', '2024-02-28 07:50:42', '2024-03-01 09:48:58', 0),
(43, 2, 'Kristine Kerr', 'Oakland, New Zealand', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:Arial, Helvetica, sans-serif;font-size:12.96px;\">A somewhat belated thank you very much for your excellent service. I was both pleased and impressed with your company’s efficiency, attention to detail and prompt responses</span></p>', '2024-02-28 07:50:59', '2024-03-01 09:13:48', 2),
(44, 2, 'Wouter Nijland', 'Saudi Arabia to United Kingdom ', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(32,33,36);font-family:arial, sans-serif;font-size:13px;\">I used this company to move my kids bikes and some boxes back from Saudi to the UK. I received excellent service from start to finish. the guys who came to pack-up the pallet were excellent and really new how to minimize the volume weight of the shipping.</span></p>', '2024-02-28 07:51:32', '2024-03-12 05:12:05', 0);
