INSERT INTO `testimonial` (`id`, `name`, `location`, `comment`, `created_at`, `updated_at`, `status`) VALUES
(1, 'Mohammad Ansari', 'Saudi Arabia to India', '<p>On Behalf of Mubashira, would love to take an opportunity to thank Aegis Logistics &amp; Int&#39;l movers for variety professional services of pickup,loading, coordinate and email exchange.</p>\r\n', '2023-10-07 05:49:07', '2023-10-07 05:49:07', 0),
(2, 'Kristine Kerr', 'Oakland, New Zealand', '<p>A somewhat belated thank you very much for your excellent service. I was both pleased and impressed with your company&rsquo;s efficiency, attention to detail and prompt responses</p>\r\n', '2023-10-07 05:51:01', '2023-10-07 05:51:01', 0),
(3, 'Ms.Farah Zafar', '', '<p>I wanted to thank you and your team for doing a great job. We both received our goods in Dubai and were very happy with the service.</p>\r\n', '2023-10-07 05:51:40', '2023-10-07 06:06:12', 0),
(4, 'Mr. Atikan Teber', 'Riyadh to USA', '<p>I would like acknowledge the exceptionally great service received from your guys on packing our belongings. I will definitely recommend your company to my friends and colleagues.</p>\r\n', '2023-10-07 05:52:24', '2023-10-07 06:07:02', 0),
(5, 'Mr. Abdul rahiman', 'Riyadh to Turkey', '<p>I was really impressed with level of professionalism that the team has shown...Certainly i will recommend the services to others</p>\r\n', '2023-10-07 05:52:50', '2023-10-07 06:07:17', 0),
(6, 'Mrs. Sarah Basrawi', 'Jeddah to Riyad', '<p>Services provided at origin and destination such as the quality of packing,labeling , organization and attitude of crew was excellent . keep it up</p>\r\n', '2023-10-07 05:53:20', '2023-10-07 05:53:20', 0),
(7, 'Mr. Norman J Leite', 'Saudi Arabia to Bahrain', '<p>No issue at all and thank you Riyas, and also thank you for your prompt and efficient service.</p>\r\n', '2023-10-07 05:53:51', '2023-10-07 06:07:32', 0),
(8, 'Mr. Kiriakose Skarpas', 'Riyadh to Greece', '<p>The team arrived on time. Equiped with all necessary tools and knowing exactly their job. Tottaly very professional service.</p>\r\n', '2023-10-07 05:54:20', '2023-10-07 05:54:20', 0),
(9, 'Mr. Amir Imam', 'Riyadh to Dubai', '<p>I&#39;d like to extend our appreciation and thanks for a very professional team. The whole family is very satisfied with the service.</p>\r\n', '2023-10-07 05:54:54', '2023-10-07 05:54:54', 0),
(10, 'Kinda Helmi', 'UAE to KSA', '<p>Team Saudi Arabia was very professional and accomodating . Thanks you very much.</p>\r\n', '2023-10-07 05:55:23', '2023-10-07 05:55:23', 0),
(11, 'Shakil Mujawar', '', '<p>My shipment was picked up.today and everything went off very well. It was very professional and I appreciate it a lot. Thx for the very fluent support.</p>\r\n', '2023-10-07 05:59:28', '2023-10-07 06:04:26', 0),
(12, 'Mr. Junaid Ali', 'Jeddah to Khobar ( Saudi Arabia )', '<p>Many thanks for delivering an exceptional service. The teams were extremely professional and committed. They carried out their duties with utmost care and responsibility. I was completely satisfied</p>\r\n', '2023-10-07 05:59:57', '2023-10-07 05:59:57', 0),
(13, 'Dr Rafay Iqbal', 'Riyadh to Karachi', '<p>The shipment arrived well in time, before I start my job next week. The cargo was handled very professionally by you and Karachi counterpart as well.</p>\r\n', '2023-10-07 06:01:26', '2023-10-07 06:01:26', 0),
(14, 'Mark Allchin', 'Saudi Arabia To Kenya', '<p>I would like to thank amazing team at Aegis Logistics for an excellent service in moving my household goods abroad.</p>\r\n', '2023-10-07 06:01:54', '2023-10-07 06:01:54', 0),
(15, 'Mr. Maysan AlShaar', 'Riyadh to Usa', '<p>Very professional, hard working, available for questions or concerns<br />\r\nFurniture received in the best way<br />\r\nI highly recommend this company<br />\r\nA very successful experience and their prices are reasonable</p>\r\n', '2023-10-26 10:34:55', '2023-10-26 10:34:55', 0),
(16, 'Ms. María Calvente Aldea ', 'Riyadh to Spain', '<p>Very professional team, all my items are perfect. Nothing lost. The team in saudi and the team in Spain very helpful and professional. I highly recommend this company. Good price comparing with others companies.</p>\r\n', '2023-10-26 10:41:50', '2023-10-26 10:41:50', 0),
(17, 'Mr. Sanjay Thakur', 'Jeddah to Riyadh', '<p>Amazing, professional and very Helpful staff.<br />\r\nHad one of the best and hassle free experience.</p>\r\n', '2023-10-26 10:42:29', '2023-10-26 10:42:29', 0),
(18, 'Dr. Umar Farouqi', 'Riyad to Bahrain', '<p>Had to shift from saudi to Kingdom of Bahrain<br />\r\nFound Aegis Logistics as most professional and consumer friendly company.<br />\r\nHighly recommended for m@p services.<br />\r\nMr Nizam from saudi and Mr Jose from bahrain were particularly helpful.</p>\r\n', '2023-10-26 10:43:03', '2023-10-26 10:43:03', 0),
(19, 'Jacqueline Newton', 'Dammam to UK', '<p>The logistics company were great very professional very quick, and the quote was much less than other companies. The shipment arrived safe and quickly. The staff are excellent I would recommend using</p>\r\n', '2023-10-26 10:43:36', '2023-10-26 10:43:36', 0),
(20, 'Eric Niborg', 'Riyadh to Usa', '<p>I had a great experience with this company. Account manager extremely customer service oriented and professional. Straight quotation all inclusive with no gimmicks. Exactly on time service and very accommodating of my schedule, working the weekend and evening. The crew very experienced, careful, professional and courteous. Al my goods arrived 100% undamaged. Highly recommend!</p>\r\n', '2023-10-26 10:44:40', '2023-10-26 10:44:40', 0),
(21, 'Mr. Bilal Ahmed', 'Riyadh to UK', '<p>I used them for relocating from Riyadh to London.<br />\r\nThey have a very professional team.<br />\r\nI would really appreciate Mr. Nisam who have been supportive throughout the whole process.</p>\r\n', '2023-10-26 10:45:19', '2023-10-26 10:45:19', 0),
(22, 'Benjamin Wessendorf', 'Riyadh, KSA', '<p>Excellent Service. Highly recommended. Well trained, polite and professional team and Management. 5 star rating well deserved!!!</p>\r\n', '2023-10-26 10:46:05', '2023-10-26 10:46:05', 0),
(23, 'Matias Vaira, PhD | Director of Economics', 'PIF -  Real Estate Assets Management', '<p>My family of four moved from Riyadh KSA to regional NSW, Sydney Australia.&nbsp;I would highly recommend this service for their professional and efficiency.&nbsp;<br>The team in Riyadh packed our things with care and courtesy and they were polite.&nbsp;The team from Sydney also made relocation easier with efficiency and good manners. They showed initiative and care with unloading and unpacking.&nbsp;</p>', '2024-03-18 07:11:45', '2024-03-18 07:12:56', 0),
(24, 'The Meyer family', '', '<p>Dear Team, Thank you for shipping our belongings to Hong Kong. &nbsp;As any move is extremely stressful, you managed to minimize that for us. Your team is sufficient and trustworthy. &nbsp;We would recommend your company to anyone that requires to move internationally. &nbsp;<br>Thank you once again for all your assistance.</p>', '2024-03-20 04:10:09', '2024-03-20 04:11:43', 0);
